(15, 1, -1, 12, '2016-03-19', '2016-03-20', NULL, '- 5 Spielhallen\r\n- Übernachtung, Frühstück und Abendessen an einem Ort  \r\n- Badespaß am Samstagabend  \r\n- In der Team-Fee enthalten: Frühstück, Team-Wasser und Obst über den Tag\r\n- Abendessen buchbar bei Spieleranmeldung auf www.judm-beckum.de Nudeln mit verschiedenen Soßen und Salat \r\n- All you can eat!\r\n\r\nDer Spielplan wird spätestens am 6. März veröffentlicht.', 'Deutsche Meisterschaft Indoor Junioren 2016'),
(16, 1, -1, 13, '2016-04-23', '2016-04-24', 2, 'Liebe alte Säcke\r\n\r\nEs ist so weit – die Saison beginnt.\r\nKramt eure alten Knochen aus der Kiste und Laufschuhe unten dran……\r\n\r\nDie Anmeldung ist erst gesichert, nach Überweisung von 50 EUR Saisongebühr an das Konto des DFV:\r\nDeutscher FrisbeesportverbandIBAN DE37241512350075164467\r\nBlz 24151235\r\nKto 75164467\r\n\r\nTeamfee (200 EUR) bitte an\r\nRüdiger Veitl\r\nIBAN: DE32200411440462990300', 'Deutsche Meisterschaft Masters 2016'),
(17, 1, -1, 15, '2016-05-14', '2016-05-15', 3, NULL, 'European Frisbee Festival 2016'),
(18, 1, -1, 16, '2016-05-28', '2016-05-29', NULL, NULL, 'Qualifikation Nord-West zur Deutschen Meisterschaft Mixed 2016 '),
(19, 1, -1, 16, '2016-05-28', '2016-05-29', NULL, 'Die Saxy Divers richten die Qualifikation Nord-Ost zur Deutschen Meisterschaft Mixed 2016 im Ultimate Frisbee auf dem Gelände des 1. FC Lokomotive Leipzig e.V. aus. Dabei gibts es für die Teams aus Sachsen, Sachsen-Anhalt, Brandenburg, Berlin und Meckblenburg-Vorpommern jeweils 3 Spots für die 1.Liga und 4 Spots für die 2. Liga zu gewinnen. Also kommt zahlreich und bringt eure Freunde mit!', 'Qualifikation Nord-Ost zur Deutschen Meisterschaft Mixed 2016 '),
(20, 1, -1, 16, '2016-05-28', '2016-05-29', 6, 'Einer der beiden Plätze ist Kunstrasen. \r\n\r\nBitte zeitnah Bescheid geben wieviele Leute frühstücken möchten.\r\n\r\nAm Samstag abend soll auf dem Gelände des TVE ein Showcase-game der U17 Mädels gegen die weiblichen "All-Stars" aus den mixed Teams stattfinden. Ziel ist mit einem hochattraktiven Testspiel ein kleines "Crowd"-funding für die U17 Mädels auf dem Weg zur EM nach Belgien zusammenzubekommen. \r\nNähere Infos folgen.', 'Qualifikation Süd-West zur Deutschen Meisterschaft Mixed 2016 '),
(21, 1, -1, 16, '2016-05-28', '2016-05-29', 7, NULL, 'Qualifikation Süd-Ost zur Deutschen Meisterschaft Mixed 2016'),
(22, 1, -1, 17, '2016-07-02', '2016-07-03', NULL, 'Wir TeKielas freuen uns, mal wieder einen Teil einer DM bei uns durchführen zu dürfen.Auch wenn es für einige sehr weit ist, es lohnt sich !\r\n\r\nUm Euch einen Eindruck über die Örtlichkeiten zu geben, haben wir eine kleine Karte vorbereitet (siehe unten).\r\n\r\nWeitere Infos zur Anmeldung für Frühstück, Mittag und Zelten, sowie für die Party am Samstagabend am Strand mit BBQ kommen demnächst.', 'Deutsche Meisterschaft 2. Liga Mixed 2016'),
