(28, 1, -1, 20, '2016-09-17', '2016-09-18', 9, 'Verpflegung:\r\n\r\nFrühstück am Samstag und Sonntag jeweils  07.00 – 09.00 Uhr auf der Sportanlage (s.o.)\r\n\r\nAbendessen (auch vegetarisch) nach Voranmeldung auf der Sportanlage (dies ist nicht in der teamfee enthalten)\r\n\r\nCatering tagsüber: Salate, Hotdogs, Pommes, Waffeln, Joghurts, etc, Getränke\r\n\r\n\r\nModus, Spielplan, alles zum Ablauf erfolgt demnächst.', 'Deutsche Meisterschaft Junioren 2016'),
(29, 1, -1, 21, '2016-09-02', '2016-09-04', NULL, '***\r\nWir danken Jump + Reach / GAIA Europe für die Stiftung der Spirit of the Game Auszeichnungen.\r\nwww.JUMP-and-REACH.com/GAIA-SpiritSponsorship\r\n\r\n***\r\nEs gibt verschiedene Übernachtungsmöglichkeiten:\r\n\r\nZwei Schlafhallen - Buchung über Formular - siehe unten. Die Übernachtung kostet 7€ pro Person/pro Nacht und ist aus organisatorischen Gründen nur teamweise möglich.\r\n\r\nJugendgästehaus - kann noch gebucht werden, siehe angehängte Mail von Ulle vom 26.Juni.\r\n\r\ndiverse Hotels - selbständige Buchung, bspw. Ibis Hotel am Hauptbahnhof, Hostels in der Dresdner Neustadt wären teurere Alternativen\r\n\r\n***\r\nFrühstück: Das von den DM-Veranstaltern organisierte Frühstück kostet 3,50€ pro Person/pro Frühstück und kann teamweise gebucht werden. Buchung über Formular - siehe unten. (Beachte: Teams, die sich ins Jugendgästehaus eingebucht haben, haben dort ein Frühstück mitgebucht.)\r\n\r\n***\r\nBitte füllt das unten verlinkte Formular bis zum 17. August aus.', '36. Deutsche Meisterschaft Open/Damen 2016'),
(30, 1, -1, 19, '2016-07-23', '2016-07-24', NULL, 'Hallo liebe Reli Teams!\r\n\r\nWir Heidschnucken freuen uns, euch für die A-Reli dieses Jahr ins schöne Hannover einladen zu dürfen. Wir werden auf dem Gelände des SG74 sein; hier können wir spielen, zelten, duschen - alles an einem Ort. \r\n\r\nUm euch gebührend zu empfangen haben wir außerdem ein Feuerwerk für euch organisiert... lasst euch überraschen ;-)\r\n\r\nBei Fragen könnt ihr euch gerne jederzeit an uns wenden: \r\nareli-2016@funaten.de', 'Relegation zur Deutschen Meisterschaft Damen 2016'),
